@testset "6.1.1 (c+d x)^m (a+b sinh)^n" begin
    @variables a, b, c, d, e, f, m, n, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(e+f*x)^m*(b*sinh(c+d*x))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^m*(b*sinh(e+f*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^m*sinh(e+f*x)^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [(c + d*x)^4*sinh(a + b*x), x, 5, (24*d^4*cosh(a + b*x))/b^5 + (12*d^2*(c + d*x)^2*cosh(a + b*x))/b^3 + ((c + d*x)^4*cosh(a + b*x))/b - (24*d^3*(c + d*x)*sinh(a + b*x))/b^4 - (4*d*(c + d*x)^3*sinh(a + b*x))/b^2]
    @test_int [(c + d*x)^3*sinh(a + b*x), x, 4, (6*d^2*(c + d*x)*cosh(a + b*x))/b^3 + ((c + d*x)^3*cosh(a + b*x))/b - (6*d^3*sinh(a + b*x))/b^4 - (3*d*(c + d*x)^2*sinh(a + b*x))/b^2]
    @test_int [(c + d*x)^2*sinh(a + b*x), x, 3, (2*d^2*cosh(a + b*x))/b^3 + ((c + d*x)^2*cosh(a + b*x))/b - (2*d*(c + d*x)*sinh(a + b*x))/b^2]
    @test_int [(c + d*x)*sinh(a + b*x), x, 2, ((c + d*x)*cosh(a + b*x))/b - (d*sinh(a + b*x))/b^2]
    @test_int [sinh(a + b*x)/(c + d*x), x, 3, (CoshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/d + (cosh(a - (b*c)/d)*SinhIntegral((b*c)/d + b*x))/d]
    @test_int [sinh(a + b*x)/(c + d*x)^2, x, 4, (b*cosh(a - (b*c)/d)*CoshIntegral((b*c)/d + b*x))/d^2 - sinh(a + b*x)/(d*(c + d*x)) + (b*sinh(a - (b*c)/d)*SinhIntegral((b*c)/d + b*x))/d^2]
    @test_int [sinh(a + b*x)/(c + d*x)^3, x, 5, -(b*cosh(a + b*x))/(2*d^2*(c + d*x)) + (b^2*CoshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/(2*d^3) - sinh(a + b*x)/(2*d*(c + d*x)^2) + (b^2*cosh(a - (b*c)/d)*SinhIntegral((b*c)/d + b*x))/(2*d^3)]


    @test_int [(c + d*x)^4*sinh(a + b*x)^2, x, 6, (-3*d^4*x)/(4*b^4) - (d*(c + d*x)^3)/(2*b^2) - (c + d*x)^5/(10*d) + (3*d^4*cosh(a + b*x)*sinh(a + b*x))/(4*b^5) + (3*d^2*(c + d*x)^2*cosh(a + b*x)*sinh(a + b*x))/(2*b^3) + ((c + d*x)^4*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (3*d^3*(c + d*x)*sinh(a + b*x)^2)/(2*b^4) - (d*(c + d*x)^3*sinh(a + b*x)^2)/b^2]
    @test_int [(c + d*x)^3*sinh(a + b*x)^2, x, 4, (-3*c*d^2*x)/(4*b^2) - (3*d^3*x^2)/(8*b^2) - (c + d*x)^4/(8*d) + (3*d^2*(c + d*x)*cosh(a + b*x)*sinh(a + b*x))/(4*b^3) + ((c + d*x)^3*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (3*d^3*sinh(a + b*x)^2)/(8*b^4) - (3*d*(c + d*x)^2*sinh(a + b*x)^2)/(4*b^2)]
    @test_int [(c + d*x)^2*sinh(a + b*x)^2, x, 4, -(d^2*x)/(4*b^2) - (c + d*x)^3/(6*d) + (d^2*cosh(a + b*x)*sinh(a + b*x))/(4*b^3) + ((c + d*x)^2*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (d*(c + d*x)*sinh(a + b*x)^2)/(2*b^2)]
    @test_int [(c + d*x)*sinh(a + b*x)^2, x, 2, -(c*x)/2 - (d*x^2)/4 + ((c + d*x)*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (d*sinh(a + b*x)^2)/(4*b^2)]
    @test_int [sinh(a + b*x)^2/(c + d*x), x, 5, (cosh(2*a - (2*b*c)/d)*CoshIntegral((2*b*c)/d + 2*b*x))/(2*d) - log(c + d*x)/(2*d) + (sinh(2*a - (2*b*c)/d)*SinhIntegral((2*b*c)/d + 2*b*x))/(2*d)]
    @test_int [sinh(a + b*x)^2/(c + d*x)^2, x, 5, (b*CoshIntegral((2*b*c)/d + 2*b*x)*sinh(2*a - (2*b*c)/d))/d^2 - sinh(a + b*x)^2/(d*(c + d*x)) + (b*cosh(2*a - (2*b*c)/d)*SinhIntegral((2*b*c)/d + 2*b*x))/d^2]
    @test_int [sinh(a + b*x)^2/(c + d*x)^3, x, 7, (b^2*cosh(2*a - (2*b*c)/d)*CoshIntegral((2*b*c)/d + 2*b*x))/d^3 - (b*cosh(a + b*x)*sinh(a + b*x))/(d^2*(c + d*x)) - sinh(a + b*x)^2/(2*d*(c + d*x)^2) + (b^2*sinh(2*a - (2*b*c)/d)*SinhIntegral((2*b*c)/d + 2*b*x))/d^3]
    @test_int [sinh(a + b*x)^2/(c + d*x)^4, x, 7, -b^2/(3*d^3*(c + d*x)) + (2*b^3*CoshIntegral((2*b*c)/d + 2*b*x)*sinh(2*a - (2*b*c)/d))/(3*d^4) - (b*cosh(a + b*x)*sinh(a + b*x))/(3*d^2*(c + d*x)^2) - sinh(a + b*x)^2/(3*d*(c + d*x)^3) - (2*b^2*sinh(a + b*x)^2)/(3*d^3*(c + d*x)) + (2*b^3*cosh(2*a - (2*b*c)/d)*SinhIntegral((2*b*c)/d + 2*b*x))/(3*d^4)]


    @test_int [(c + d*x)^4*sinh(a + b*x)^3, x, 12, (-488*d^4*cosh(a + b*x))/(27*b^5) - (80*d^2*(c + d*x)^2*cosh(a + b*x))/(9*b^3) - (2*(c + d*x)^4*cosh(a + b*x))/(3*b) + (8*d^4*cosh(a + b*x)^3)/(81*b^5) + (160*d^3*(c + d*x)*sinh(a + b*x))/(9*b^4) + (8*d*(c + d*x)^3*sinh(a + b*x))/(3*b^2) + (4*d^2*(c + d*x)^2*cosh(a + b*x)*sinh(a + b*x)^2)/(9*b^3) + ((c + d*x)^4*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (8*d^3*(c + d*x)*sinh(a + b*x)^3)/(27*b^4) - (4*d*(c + d*x)^3*sinh(a + b*x)^3)/(9*b^2)]
    @test_int [(c + d*x)^3*sinh(a + b*x)^3, x, 8, (-40*d^2*(c + d*x)*cosh(a + b*x))/(9*b^3) - (2*(c + d*x)^3*cosh(a + b*x))/(3*b) + (40*d^3*sinh(a + b*x))/(9*b^4) + (2*d*(c + d*x)^2*sinh(a + b*x))/b^2 + (2*d^2*(c + d*x)*cosh(a + b*x)*sinh(a + b*x)^2)/(9*b^3) + ((c + d*x)^3*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (2*d^3*sinh(a + b*x)^3)/(27*b^4) - (d*(c + d*x)^2*sinh(a + b*x)^3)/(3*b^2)]
    @test_int [(c + d*x)^2*sinh(a + b*x)^3, x, 6, (-14*d^2*cosh(a + b*x))/(9*b^3) - (2*(c + d*x)^2*cosh(a + b*x))/(3*b) + (2*d^2*cosh(a + b*x)^3)/(27*b^3) + (4*d*(c + d*x)*sinh(a + b*x))/(3*b^2) + ((c + d*x)^2*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (2*d*(c + d*x)*sinh(a + b*x)^3)/(9*b^2)]
    @test_int [(c + d*x)*sinh(a + b*x)^3, x, 3, (-2*(c + d*x)*cosh(a + b*x))/(3*b) + (2*d*sinh(a + b*x))/(3*b^2) + ((c + d*x)*cosh(a + b*x)*sinh(a + b*x)^2)/(3*b) - (d*sinh(a + b*x)^3)/(9*b^2)]
    @test_int [sinh(a + b*x)^3/(c + d*x), x, 8, (CoshIntegral((3*b*c)/d + 3*b*x)*sinh(3*a - (3*b*c)/d))/(4*d) - (3*CoshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/(4*d) - (3*cosh(a - (b*c)/d)*SinhIntegral((b*c)/d + b*x))/(4*d) + (cosh(3*a - (3*b*c)/d)*SinhIntegral((3*b*c)/d + 3*b*x))/(4*d)]
    @test_int [sinh(a + b*x)^3/(c + d*x)^2, x, 8, (-3*b*cosh(a - (b*c)/d)*CoshIntegral((b*c)/d + b*x))/(4*d^2) + (3*b*cosh(3*a - (3*b*c)/d)*CoshIntegral((3*b*c)/d + 3*b*x))/(4*d^2) - sinh(a + b*x)^3/(d*(c + d*x)) - (3*b*sinh(a - (b*c)/d)*SinhIntegral((b*c)/d + b*x))/(4*d^2) + (3*b*sinh(3*a - (3*b*c)/d)*SinhIntegral((3*b*c)/d + 3*b*x))/(4*d^2)]
    @test_int [sinh(a + b*x)^3/(c + d*x)^3, x, 12, (9*b^2*CoshIntegral((3*b*c)/d + 3*b*x)*sinh(3*a - (3*b*c)/d))/(8*d^3) - (3*b^2*CoshIntegral((b*c)/d + b*x)*sinh(a - (b*c)/d))/(8*d^3) - (3*b*cosh(a + b*x)*sinh(a + b*x)^2)/(2*d^2*(c + d*x)) - sinh(a + b*x)^3/(2*d*(c + d*x)^2) - (3*b^2*cosh(a - (b*c)/d)*SinhIntegral((b*c)/d + b*x))/(8*d^3) + (9*b^2*cosh(3*a - (3*b*c)/d)*SinhIntegral((3*b*c)/d + 3*b*x))/(8*d^3)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [(c + d*x)^3*csch(a + b*x), x, 9, (-2*(c + d*x)^3*atanh(ℯ^(a + b*x)))/b - (3*d*(c + d*x)^2*PolyLog(2, -ℯ^(a + b*x)))/b^2 + (3*d*(c + d*x)^2*PolyLog(2, ℯ^(a + b*x)))/b^2 + (6*d^2*(c + d*x)*PolyLog(3, -ℯ^(a + b*x)))/b^3 - (6*d^2*(c + d*x)*PolyLog(3, ℯ^(a + b*x)))/b^3 - (6*d^3*PolyLog(4, -ℯ^(a + b*x)))/b^4 + (6*d^3*PolyLog(4, ℯ^(a + b*x)))/b^4]
    @test_int [(c + d*x)^2*csch(a + b*x), x, 7, (-2*(c + d*x)^2*atanh(ℯ^(a + b*x)))/b - (2*d*(c + d*x)*PolyLog(2, -ℯ^(a + b*x)))/b^2 + (2*d*(c + d*x)*PolyLog(2, ℯ^(a + b*x)))/b^2 + (2*d^2*PolyLog(3, -ℯ^(a + b*x)))/b^3 - (2*d^2*PolyLog(3, ℯ^(a + b*x)))/b^3]
    @test_int [(c + d*x)*csch(a + b*x), x, 5, (-2*(c + d*x)*atanh(ℯ^(a + b*x)))/b - (d*PolyLog(2, -ℯ^(a + b*x)))/b^2 + (d*PolyLog(2, ℯ^(a + b*x)))/b^2]
    @test_int [csch(a + b*x)/(c + d*x), x, 0, Unintegrable(csch(a + b*x)/(c + d*x), x)]
    @test_int [csch(a + b*x)/(c + d*x)^2, x, 0, Unintegrable(csch(a + b*x)/(c + d*x)^2, x)]


    @test_int [(c + d*x)^3*csch(a + b*x)^2, x, 6, -((c + d*x)^3/b) - ((c + d*x)^3*coth(a + b*x))/b + (3*d*(c + d*x)^2*log(1 - ℯ^(2*(a + b*x))))/b^2 + (3*d^2*(c + d*x)*PolyLog(2, ℯ^(2*(a + b*x))))/b^3 - (3*d^3*PolyLog(3, ℯ^(2*(a + b*x))))/(2*b^4)]
    @test_int [(c + d*x)^2*csch(a + b*x)^2, x, 5, -((c + d*x)^2/b) - ((c + d*x)^2*coth(a + b*x))/b + (2*d*(c + d*x)*log(1 - ℯ^(2*(a + b*x))))/b^2 + (d^2*PolyLog(2, ℯ^(2*(a + b*x))))/b^3]
    @test_int [(c + d*x)*csch(a + b*x)^2, x, 2, -(((c + d*x)*coth(a + b*x))/b) + (d*log(sinh(a + b*x)))/b^2]
    @test_int [csch(a + b*x)^2/(c + d*x), x, 0, Unintegrable(csch(a + b*x)^2/(c + d*x), x)]
    @test_int [csch(a + b*x)^2/(c + d*x)^2, x, 0, Unintegrable(csch(a + b*x)^2/(c + d*x)^2, x)]


    @test_int [(c + d*x)^3*csch(a + b*x)^3, x, 15, (-6*d^2*(c + d*x)*atanh(ℯ^(a + b*x)))/b^3 + ((c + d*x)^3*atanh(ℯ^(a + b*x)))/b - (3*d*(c + d*x)^2*csch(a + b*x))/(2*b^2) - ((c + d*x)^3*coth(a + b*x)*csch(a + b*x))/(2*b) - (3*d^3*PolyLog(2, -ℯ^(a + b*x)))/b^4 + (3*d*(c + d*x)^2*PolyLog(2, -ℯ^(a + b*x)))/(2*b^2) + (3*d^3*PolyLog(2, ℯ^(a + b*x)))/b^4 - (3*d*(c + d*x)^2*PolyLog(2, ℯ^(a + b*x)))/(2*b^2) - (3*d^2*(c + d*x)*PolyLog(3, -ℯ^(a + b*x)))/b^3 + (3*d^2*(c + d*x)*PolyLog(3, ℯ^(a + b*x)))/b^3 + (3*d^3*PolyLog(4, -ℯ^(a + b*x)))/b^4 - (3*d^3*PolyLog(4, ℯ^(a + b*x)))/b^4]
    @test_int [(c + d*x)^2*csch(a + b*x)^3, x, 9, ((c + d*x)^2*atanh(ℯ^(a + b*x)))/b - (d^2*atanh(cosh(a + b*x)))/b^3 - (d*(c + d*x)*csch(a + b*x))/b^2 - ((c + d*x)^2*coth(a + b*x)*csch(a + b*x))/(2*b) + (d*(c + d*x)*PolyLog(2, -ℯ^(a + b*x)))/b^2 - (d*(c + d*x)*PolyLog(2, ℯ^(a + b*x)))/b^2 - (d^2*PolyLog(3, -ℯ^(a + b*x)))/b^3 + (d^2*PolyLog(3, ℯ^(a + b*x)))/b^3]
    @test_int [(c + d*x)*csch(a + b*x)^3, x, 6, ((c + d*x)*atanh(ℯ^(a + b*x)))/b - (d*csch(a + b*x))/(2*b^2) - ((c + d*x)*coth(a + b*x)*csch(a + b*x))/(2*b) + (d*PolyLog(2, -ℯ^(a + b*x)))/(2*b^2) - (d*PolyLog(2, ℯ^(a + b*x)))/(2*b^2)]
    @test_int [csch(a + b*x)^3/(c + d*x), x, 0, Unintegrable(csch(a + b*x)^3/(c + d*x), x)]
    @test_int [csch(a + b*x)^3/(c + d*x)^2, x, 0, Unintegrable(csch(a + b*x)^3/(c + d*x)^2, x)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^(m/2)*sinh(e+f*x)^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [(c + d*x)^(5/2)*sinh(a + b*x), x, 8, (15*d^2*sqrt(c + d*x)*cosh(a + b*x))/(4*b^3) + ((c + d*x)^(5/2)*cosh(a + b*x))/b - (15*d^(5/2)*ℯ^(-a + (b*c)/d)*sqrt(pi)*Erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(7/2)) - (15*d^(5/2)*ℯ^(a - (b*c)/d)*sqrt(pi)*Erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(7/2)) - (5*d*(c + d*x)^(3/2)*sinh(a + b*x))/(2*b^2)]
    @test_int [(c + d*x)^(3/2)*sinh(a + b*x), x, 7, ((c + d*x)^(3/2)*cosh(a + b*x))/b - (3*d^(3/2)*ℯ^(-a + (b*c)/d)*sqrt(pi)*Erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(8*b^(5/2)) + (3*d^(3/2)*ℯ^(a - (b*c)/d)*sqrt(pi)*Erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(8*b^(5/2)) - (3*d*sqrt(c + d*x)*sinh(a + b*x))/(2*b^2)]
    @test_int [sqrt(c + d*x)*sinh(a + b*x), x, 6, (sqrt(c + d*x)*cosh(a + b*x))/b - (sqrt(d)*ℯ^(-a + (b*c)/d)*sqrt(pi)*Erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*b^(3/2)) - (sqrt(d)*ℯ^(a - (b*c)/d)*sqrt(pi)*Erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*b^(3/2))]
    @test_int [sinh(a + b*x)/sqrt(c + d*x), x, 5, -(ℯ^(-a + (b*c)/d)*sqrt(pi)*Erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(2*sqrt(b)*sqrt(d)) + (ℯ^(a - (b*c)/d)*sqrt(pi)*Erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(2*sqrt(b)*sqrt(d))]
    @test_int [sinh(a + b*x)/(c + d*x)^(3/2), x, 6, (sqrt(b)*ℯ^(-a + (b*c)/d)*sqrt(pi)*Erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/d^(3/2) + (sqrt(b)*ℯ^(a - (b*c)/d)*sqrt(pi)*Erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/d^(3/2) - (2*sinh(a + b*x))/(d*sqrt(c + d*x))]
    @test_int [sinh(a + b*x)/(c + d*x)^(5/2), x, 7, (-4*b*cosh(a + b*x))/(3*d^2*sqrt(c + d*x)) - (2*b^(3/2)*ℯ^(-a + (b*c)/d)*sqrt(pi)*Erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(3*d^(5/2)) + (2*b^(3/2)*ℯ^(a - (b*c)/d)*sqrt(pi)*Erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(3*d^(5/2)) - (2*sinh(a + b*x))/(3*d*(c + d*x)^(3/2))]
    @test_int [sinh(a + b*x)/(c + d*x)^(7/2), x, 8, (-4*b*cosh(a + b*x))/(15*d^2*(c + d*x)^(3/2)) + (4*b^(5/2)*ℯ^(-a + (b*c)/d)*sqrt(pi)*Erf((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(15*d^(7/2)) + (4*b^(5/2)*ℯ^(a - (b*c)/d)*sqrt(pi)*Erfi((sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(15*d^(7/2)) - (2*sinh(a + b*x))/(5*d*(c + d*x)^(5/2)) - (8*b^2*sinh(a + b*x))/(15*d^3*sqrt(c + d*x))]


    @test_int [(c + d*x)^(5/2)*sinh(a + b*x)^2, x, 10, (-5*d*(c + d*x)^(3/2))/(16*b^2) - (c + d*x)^(7/2)/(7*d) + (15*d^(5/2)*ℯ^(-2*a + (2*b*c)/d)*sqrt(pi/2)*Erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(256*b^(7/2)) - (15*d^(5/2)*ℯ^(2*a - (2*b*c)/d)*sqrt(pi/2)*Erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(256*b^(7/2)) + ((c + d*x)^(5/2)*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (5*d*(c + d*x)^(3/2)*sinh(a + b*x)^2)/(8*b^2) + (15*d^2*sqrt(c + d*x)*sinh(2*a + 2*b*x))/(64*b^3)]
    @test_int [(c + d*x)^(3/2)*sinh(a + b*x)^2, x, 9, (-3*d*sqrt(c + d*x))/(16*b^2) - (c + d*x)^(5/2)/(5*d) + (3*d^(3/2)*ℯ^(-2*a + (2*b*c)/d)*sqrt(pi/2)*Erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(64*b^(5/2)) + (3*d^(3/2)*ℯ^(2*a - (2*b*c)/d)*sqrt(pi/2)*Erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(64*b^(5/2)) + ((c + d*x)^(3/2)*cosh(a + b*x)*sinh(a + b*x))/(2*b) - (3*d*sqrt(c + d*x)*sinh(a + b*x)^2)/(8*b^2)]
    @test_int [sqrt(c + d*x)*sinh(a + b*x)^2, x, 8, -(c + d*x)^(3/2)/(3*d) + (sqrt(d)*ℯ^(-2*a + (2*b*c)/d)*sqrt(pi/2)*Erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(3/2)) - (sqrt(d)*ℯ^(2*a - (2*b*c)/d)*sqrt(pi/2)*Erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(16*b^(3/2)) + (sqrt(c + d*x)*sinh(2*a + 2*b*x))/(4*b)]
    @test_int [sinh(a + b*x)^2/sqrt(c + d*x), x, 7, -(sqrt(c + d*x)/d) + (ℯ^(-2*a + (2*b*c)/d)*sqrt(pi/2)*Erf((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*sqrt(b)*sqrt(d)) + (ℯ^(2*a - (2*b*c)/d)*sqrt(pi/2)*Erfi((sqrt(2)*sqrt(b)*sqrt(c + d*x))/sqrt(d)))/(4*sqrt(b)*sqrt(d))]
